    return(
        <div className="col-lg-6 border ">
        <img src={previewURL} className="float-left mr-2 w-25" />
    <h3>User: {user}</h3>
    <div>Tags: {tags}</div>
    <div>Views: {views}</div>
    </div>

    
    )
  }
}

export default PixaDisplay;
